import Form from 'react-bootstrap/Form';
import USD from '../../imgs/images.png'
import EUR from '../../imgs/eur.png'
import UAH from '../../imgs/uah.png'


function Select() {
    return (
        <Form.Select aria-label="Default select example">
            <option>Currency</option>
            <option value="1"><div><img src={USD} ref={'usd'} className={'flag'}/> USD</div></option>
            <option value="2"><div><img src={EUR} ref={'eur'} className={'flag'}/> EUR</div></option>
            <option value="3"><div><img src={UAH} ref={'uah'} className={'flag'}/> UAH</div></option>
        </Form.Select>
    );
}

export default Select;
